import React from "react";
import "../index.css";
import Header from "./Header.js";
import Main from "./Main.js";

function App() {
  return (
    <div class="page">
      <Header />
      <Main />

      <footer class="footer">
        <p class="footer__text">&#169; 2022 Mesto Russia</p>
      </footer>
    </div>
  );
}

export default App;
